// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import { LibAppStorage, AppStorage, CabalData, CabalPhase, ClankerV4Settings } from "../libraries/LibAppStorage.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title PoolKey
 * @notice Uniswap V4 PoolKey struct
 */
struct PoolKey {
    address currency0;
    address currency1;
    uint24 fee;
    int24 tickSpacing;
    address hooks;
}

/**
 * @title ExactInputSingleParams
 * @notice V4Router swap params (from IV4Router)
 */
struct ExactInputSingleParams {
    PoolKey poolKey;
    bool zeroForOne;
    uint128 amountIn;
    uint128 amountOutMinimum;
    bytes hookData;
}

/**
 * @title IUniversalRouter
 */
interface IUniversalRouter {
    function execute(
        bytes calldata commands,
        bytes[] calldata inputs,
        uint256 deadline
    ) external payable;
}


/**
 * @title IWETH
 */
interface IWETH {
    function deposit() external payable;
    function withdraw(uint256 amount) external;
    function approve(address spender, uint256 amount) external returns (bool);
    function transfer(address to, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

/**
 * @title SwapFacet
 * @notice Handles token swaps via Uniswap V4 for Cabal tokens
 * @dev Uses native ETH (address(0)) for pools, not WETH
 */
contract SwapFacet {
    // ============ Constants ============

    address constant UNIVERSAL_ROUTER = 0x198EF79F1F515F02dFE9e3115eD9fC07183f02fC; // V2 Router with V4 support
    address constant WETH = 0x4200000000000000000000000000000000000006;

    // Dynamic Fee Flag (0x800000)
    uint24 constant DEFAULT_FEE = 8388608; 
    int24 constant DEFAULT_TICK_SPACING = 200;

    // Universal Router Commands
    uint8 constant COMMAND_V4_SWAP = 0x10;
    uint8 constant COMMAND_SWEEP = 0x04;
    uint8 constant COMMAND_WRAP_ETH = 0x0b;
    uint8 constant COMMAND_UNWRAP_WETH = 0x0c;

    // V4 Router Actions (older version matching deployed router)
    uint8 constant SWAP_EXACT_IN_SINGLE = 0x06;
    uint8 constant SETTLE_ALL = 0x0b;
    uint8 constant TAKE_ALL = 0x0e;

    // ============ Events ============

    event TokensBought(uint256 indexed cabalId, address indexed buyer, uint256 ethAmount, uint256 tokensReceived);
    event TokensSold(uint256 indexed cabalId, address indexed seller, uint256 tokenAmount, uint256 ethReceived);

    // ============ Errors ============

    error CabalNotActive();
    error ZeroAmount();
    error InsufficientBalance();
    error SlippageExceeded();
    error InvalidToken();

    // ============ Buy Function ============

    /**
     * @notice Buy Cabal tokens with ETH
     * @param cabalId The Cabal to buy tokens from
     * @param minAmountOut Minimum tokens to receive (slippage protection)
     * @return amountOut The amount of tokens received
     */
    function buyTokens(
        uint256 cabalId,
        uint256 minAmountOut
    ) external payable returns (uint256 amountOut) {
        return buyTokensWithHookData(cabalId, minAmountOut, bytes(""));
    }

    /**
     * @notice Buy Cabal tokens with ETH, passing custom hook data
     * @param cabalId The Cabal to buy tokens from
     * @param minAmountOut Minimum tokens to receive (slippage protection)
     * @param hookData Custom data to pass to the pool's hook contract
     * @return amountOut The amount of tokens received
     */
    function buyTokensWithHookData(
        uint256 cabalId,
        uint256 minAmountOut,
        bytes memory hookData
    ) public payable returns (uint256 amountOut) {
        if (msg.value == 0) revert ZeroAmount();

        CabalData storage cabal = LibAppStorage.getCabalData(cabalId);
        if (cabal.phase != CabalPhase.Active) revert CabalNotActive();
        if (cabal.tokenAddress == address(0)) revert InvalidToken();

        ClankerV4Settings storage c = LibAppStorage.clankerV4Settings();

        uint256 balanceBefore = IERC20(cabal.tokenAddress).balanceOf(address(this));

        // Execute Swap (send ETH value with the call)
        _executeBuySwap(cabal.tokenAddress, c.hook, uint128(msg.value), uint128(minAmountOut), hookData);

        uint256 balanceAfter = IERC20(cabal.tokenAddress).balanceOf(address(this));
        amountOut = balanceAfter - balanceBefore;

        if (amountOut < minAmountOut) revert SlippageExceeded();

        IERC20(cabal.tokenAddress).transfer(msg.sender, amountOut);

        emit TokensBought(cabalId, msg.sender, msg.value, amountOut);
    }

    // ============ Sell Function ============

    /**
     * @notice Sell Cabal tokens for ETH
     * @param cabalId The Cabal to sell tokens from
     * @param tokenAmount Amount of tokens to sell
     * @param minEthOut Minimum ETH to receive (slippage protection)
     * @return ethOut The amount of ETH received
     */
    function sellTokens(
        uint256 cabalId,
        uint256 tokenAmount,
        uint256 minEthOut
    ) external returns (uint256 ethOut) {
        return sellTokensWithHookData(cabalId, tokenAmount, minEthOut, bytes(""));
    }

    /**
     * @notice Sell Cabal tokens for ETH, passing custom hook data
     * @param cabalId The Cabal to sell tokens from
     * @param tokenAmount Amount of tokens to sell
     * @param minEthOut Minimum ETH to receive (slippage protection)
     * @param hookData Custom data to pass to the pool's hook contract
     * @return ethOut The amount of ETH received
     */
    function sellTokensWithHookData(
        uint256 cabalId,
        uint256 tokenAmount,
        uint256 minEthOut,
        bytes memory hookData
    ) public returns (uint256 ethOut) {
        if (tokenAmount == 0) revert ZeroAmount();

        CabalData storage cabal = LibAppStorage.getCabalData(cabalId);
        if (cabal.phase != CabalPhase.Active) revert CabalNotActive();
        if (cabal.tokenAddress == address(0)) revert InvalidToken();

        if (IERC20(cabal.tokenAddress).balanceOf(msg.sender) < tokenAmount) {
            revert InsufficientBalance();
        }

        ClankerV4Settings storage c = LibAppStorage.clankerV4Settings();

        uint256 ethBalanceBefore = address(this).balance;

        // Transfer tokens from user to this contract, then to Router
        IERC20(cabal.tokenAddress).transferFrom(msg.sender, address(this), tokenAmount);
        IERC20(cabal.tokenAddress).transfer(UNIVERSAL_ROUTER, tokenAmount);

        // Execute Swap (Token -> ETH)
        _executeSellSwap(cabal.tokenAddress, c.hook, uint128(tokenAmount), uint128(minEthOut), hookData);

        uint256 ethBalanceAfter = address(this).balance;
        ethOut = ethBalanceAfter - ethBalanceBefore;

        // Send ETH to user
        (bool success, ) = msg.sender.call{value: ethOut}("");
        require(success, "ETH transfer failed");

        emit TokensSold(cabalId, msg.sender, tokenAmount, ethOut);
    }

    // ============ Internal Swap Functions ============

    function _executeBuySwap(
        address token,
        address hook,
        uint128 amountIn,
        uint128 minAmountOut,
        bytes memory hookData
    ) internal {
        bool zeroForOne = WETH < token;

        PoolKey memory poolKey = PoolKey({
            currency0: zeroForOne ? WETH : token,
            currency1: zeroForOne ? token : WETH,
            fee: DEFAULT_FEE,
            tickSpacing: DEFAULT_TICK_SPACING,
            hooks: hook
        });

        // Encode actions
        bytes memory actions = abi.encodePacked(
            SWAP_EXACT_IN_SINGLE,
            SETTLE_ALL,
            TAKE_ALL
        );

        bytes[] memory params = new bytes[](3);

        // Param 0: ExactInputSingleParams struct with hookData
        params[0] = abi.encode(
            ExactInputSingleParams({
                poolKey: poolKey,
                zeroForOne: zeroForOne,
                amountIn: amountIn,
                amountOutMinimum: minAmountOut,
                hookData: hookData
            })
        );

        // Param 1: SETTLE_ALL params (currency, maxAmount)
        params[1] = abi.encode(
            zeroForOne ? poolKey.currency0 : poolKey.currency1,
            amountIn
        );

        // Param 2: TAKE_ALL params (currency, minAmount)
        params[2] = abi.encode(
            zeroForOne ? poolKey.currency1 : poolKey.currency0,
            minAmountOut
        );

        // Build inputs for 3 commands: WRAP_ETH, V4_SWAP, SWEEP
        bytes[] memory inputs = new bytes[](3);

        // WRAP_ETH: Wrap ETH to WETH in Router
        inputs[0] = abi.encode(UNIVERSAL_ROUTER, uint256(amountIn));

        // V4_SWAP
        inputs[1] = abi.encode(actions, params);

        // SWEEP: send tokens from Router to this contract
        inputs[2] = abi.encode(token, address(this), uint256(0));

        // Commands: WRAP_ETH, V4_SWAP, SWEEP
        bytes memory commands = abi.encodePacked(COMMAND_WRAP_ETH, COMMAND_V4_SWAP, COMMAND_SWEEP);

        // Send native ETH with the call
        IUniversalRouter(UNIVERSAL_ROUTER).execute{value: amountIn}(commands, inputs, block.timestamp + 300);
    }

    function _executeSellSwap(
        address token,
        address hook,
        uint128 amountIn,
        uint128 minAmountOut,
        bytes memory hookData
    ) internal {
        bool zeroForOne = !(WETH < token); // Selling token for WETH

        PoolKey memory poolKey = PoolKey({
            currency0: (WETH < token) ? WETH : token,
            currency1: (WETH < token) ? token : WETH,
            fee: DEFAULT_FEE,
            tickSpacing: DEFAULT_TICK_SPACING,
            hooks: hook
        });

        bytes memory actions = abi.encodePacked(
            SWAP_EXACT_IN_SINGLE,
            SETTLE_ALL,
            TAKE_ALL
        );

        bytes[] memory params = new bytes[](3);

        params[0] = abi.encode(
            ExactInputSingleParams({
                poolKey: poolKey,
                zeroForOne: zeroForOne,
                amountIn: amountIn,
                amountOutMinimum: minAmountOut,
                hookData: hookData
            })
        );

        params[1] = abi.encode(
            zeroForOne ? poolKey.currency0 : poolKey.currency1,
            amountIn
        );

        params[2] = abi.encode(
            zeroForOne ? poolKey.currency1 : poolKey.currency0,
            minAmountOut
        );

        bytes[] memory inputs = new bytes[](2);
        inputs[0] = abi.encode(actions, params);

        // UNWRAP_WETH: unwrap and send ETH to this contract (we forward to user)
        inputs[1] = abi.encode(address(this), uint256(0));

        bytes memory commands = abi.encodePacked(COMMAND_V4_SWAP, COMMAND_UNWRAP_WETH);

        IUniversalRouter(UNIVERSAL_ROUTER).execute(commands, inputs, block.timestamp + 300);
    }

    // ============ View Functions ============

    function getPoolKey(uint256 cabalId) external view returns (
        address currency0, address currency1, uint24 fee, int24 tickSpacing, address hooks
    ) {
        CabalData storage cabal = LibAppStorage.getCabalData(cabalId);
        ClankerV4Settings storage c = LibAppStorage.clankerV4Settings();

        bool isWeth0 = WETH < cabal.tokenAddress;
        return (
            isWeth0 ? WETH : cabal.tokenAddress,
            isWeth0 ? cabal.tokenAddress : WETH,
            DEFAULT_FEE,
            DEFAULT_TICK_SPACING,
            c.hook
        );
    }

    function hasActivePool(uint256 cabalId) external view returns (bool) {
        CabalData storage cabal = LibAppStorage.getCabalData(cabalId);
        return cabal.phase == CabalPhase.Active && cabal.tokenAddress != address(0);
    }

    // Stub functions to maintain ABI compatibility
    function quoteBuy(uint256, uint256) external pure returns (uint256) {
        return 0;
    }

    function quoteSell(uint256, uint256) external pure returns (uint256) {
        return 0;
    }

    // TEMPORARY ADMIN FUNCTION
    function setCabalToken(uint256 cabalId, address token) external {
        LibAppStorage.getCabalData(cabalId).tokenAddress = token;
        LibAppStorage.getCabalData(cabalId).phase = CabalPhase.Active;
    }

    receive() external payable {}
}

